/**
 * 1. Iterar sobre as 28 posições;
 * 2. Verificar o valor da posição;
 * 3. Fazer um objeto com 4 atributos:
 *    - Andar 1
 *    - Andar 2
 *    - Andar 3
 *    - Andar 4
 *    - Andar 5
 *  4. Dependendo da posição jogar em um dos atributos
 *  5. Retornar a mensagem inteira
 * 
 *  @returns {NodeMessage}
 */

var outputMessage = {
    "andar1": { payload: [{}, {}, {}, {}, {}, {}] },
    "andar2": { payload: [{}, {}, {}, {}, {}, {}] },
    "andar3": { payload: [{}, {}, {}, {}, {}, {}] },
    "andar4": { payload: [{}, {}, {}, {}, {}, {}] },
    "andar5": { payload: [{}, {}, {}, {}] }
}

for (let i = 0; i < 28; i++) {
    var auxIndex = i;
    var currPos = positions[i];
    var floor = 1;
    while ((auxIndex + 1) > 6) {
        auxIndex -= 6;
        floor++;
    };
    outputMessage
        [`andar${floor}`]
        .payload
        [auxIndex]
        .payload = currPos.payload;
}

return Object.values(outputMessage);

